import React, { useEffect, useState } from 'react'
import { View, Text } from 'react-native'
import { useNavigation } from '@react-navigation/native';
import ApiService from '../ApiService';



interface ProfileScreenProps {
  user: string
}


export default function EventListScreen({user}: ProfileScreenProps) {

  const [myEvents, setMyEvents] = useState([])


  const navigation = useNavigation();

  useEffect(() => {
    // console.log(user)
    ApiService.getEventsList({user})
    .then (user => setMyEvents(user))
  },[],
  )


  let attendedEvents = myEvents.map((event: any) =>
  {
    return <Text>
      {event.eventName}
    </Text>;
  }
)

  return (
    <View>
      {attendedEvents}
    </View>
  )
}
